import React from "react";

import Navbar from "../components/Navbar";
import HeroSection from "../components/HeroSection";
import ProjectSlider from "../components/ProjectSlider";

function Home() {
  return (
    <div>
      <Navbar />
      <HeroSection />
      <i className="fa-solid fa-less-than fa-lg absolute bottom-[35%] z-10 left-[3%] cursor-pointer prev_btn max-lg:hidden"></i>
      <ProjectSlider/>
      <i className="fa-solid fa-greater-than fa-lg absolute bottom-[35%] right-[3%] z-10 cursor-pointer next_btn max-lg:hidden"></i>
    </div>
  );
}

export default Home;
